// import Layout from "../components/Layout";

function Yin() {
  return (

    <div className="Yin bg-gray-200">
        {/* <Layout className="bg-white">
        </Layout> */}
        <>
            <nav className="z-0 relative p-4"
                x-data="{open:false,menu:false, lokasi:false}"
            >
                <div className="flex bg-white rounded-lg text-end p-4">   
                    <h1 className="flex justify-center text-center text-xl font-bold"> Yin </h1>
                </div>
            </nav>
        </>
    </div>
  );
}

export default Yin;
